import React from "react";

const AboutUs = () => {
    return (
        <div className="about-us-page">
            <h1>О нас</h1>
            <p>
                Мы - лидер на рынке бытовой техники, потому что предлагаем не только широкий ассортимент товаров, но и высокий уровень сервиса.
                Наша компания предлагает конкурентоспособные цены, быструю доставку и гарантию на все товары.
                Мы постоянно следим за новыми трендами в сфере технологий и стремимся предоставлять нашим клиентам только самые лучшие и современные продукты.
            </p>
            <ul>
                <li>Широкий ассортимент</li>
                <li>Отличные цены</li>
                <li>Быстрая доставка</li>
                <li>Профессиональная поддержка</li>
                <li>Гарантия качества</li>
            </ul>
        </div>
    );
};



const styles = {
    container: {
        padding: '20px',
        maxWidth: '1200px',
        margin: '0 auto',
    },
    title: {
        fontSize: '32px',
        fontWeight: 'bold',
        marginBottom: '20px',
    },
    text: {
        fontSize: '18px',
        lineHeight: '1.6',
        marginBottom: '15px',
    },
};

export default AboutUs;
